import React, { Component } from "react";
import { Link } from "react-router-dom";
import Parks from "./smallparks.json";
import "./ParkPage.css";

class ParkPage extends Component {
  render() {
    let park = {
      contacts: {
        phoneNumbers: [
          {
            phoneNumber: "2024266841",
            description: "",
            extension: "",
            type: "Voice"
          }
        ],
        emailAddresses: [
          { description: "", emailAddress: "national_mall@nps.gov" }
        ]
      },
      states: "DC",
      directionsInfo:
        "The memorial is located at the corner of Vermont Avenue, 10th St, and U Street NW, near the U Street/African-American Civil War Memorial/Cardozo Metro Station.",
      directionsUrl: "http://www.nps.gov/afam/planyourvisit/directions.htm",
      url: "https://www.nps.gov/afam/index.htm",
      weatherInfo:
        "Washington DC gets to see all four seasons. Humidity will make the temps feel hotter in summer and colder in winter.\n\nSpring (March - May) Temp: Average high is 65.5 degrees with a low of 46.5 degrees\n\nSummer (June - August) Temp: Average high is 86 degrees with a low of 68.5 degrees\n\nFall (September - November) Temp: Average high is 68 degrees with a low of 51.5 degrees\n\nWinter (December - February) Temp: Average high is 45 degrees with a low of 30 degrees\n\n(Source: www.usclimatedata.com)",
      name: "African American Civil War Memorial",
      latLong: "lat:38.916554, long:-77.025977",
      description:
        "Over 200,000 African-American soldiers and sailors served in the U.S. Army and Navy during the Civil War. Their service helped to end the war and free over four million slaves. The African American Civil War Memorial honors their service and sacrifice.",
      images: [
        {
          credit: "NPS Photo",
          altText: "Site Statue",
          title: "African American Civil War Statue",
          id: "3406",
          caption: "A poignant reminder of our nations past",
          url:
            "https://www.nps.gov/common/uploads/structured_data/3C816B50-1DD8-B71B-0BF380049FB6B6A2.jpg"
        },
        {
          credit: "NPS Photo",
          altText: "African American Sailor Close up",
          title: "African American Sailor",
          id: "3407",
          caption: "African American Civil War Sailor",
          url:
            "https://www.nps.gov/common/uploads/structured_data/3C816C97-1DD8-B71B-0B7B2A0DD09C870A.jpg"
        },
        {
          credit: "NPS Photo",
          altText: "African American Soldier Close up",
          title: "African American Soldier",
          id: "3408",
          caption: "African American Civil War Soldier",
          url:
            "https://www.nps.gov/common/uploads/structured_data/3C816DF6-1DD8-B71B-0B5D792777650EA4.jpg"
        }
      ],
      designation: "",
      parkCode: "afam",
      addresses: [
        {
          postalCode: "20001",
          city: "Washington",
          stateCode: "DC",
          line1: "1925 Vermont Avenue Northwest",
          type: "Physical",
          line3: "",
          line2: ""
        },
        {
          postalCode: "20024",
          city: "Washington",
          stateCode: "DC",
          line1: "900 Ohio Drive SW",
          type: "Mailing",
          line3: "",
          line2: ""
        }
      ],
      id: "1A47416F-DAA3-4137-9F30-14AF86B4E547",
      fullName: "African American Civil War Memorial"
    };
    let ParkName = park.name;
    let ParkDescription = park.description;
    let ParkMainImage = park.images[0].url;
    let PhysicalAddress = park.addresses[0].postalcode;
    let ParkImages = park.images.map(image => {
      return <img src={image.url} className="ImageBox" />;
    });
    return (
      <div className="ParkPage">
        <div className="ParkMainImageBox">
          <img className="ParkMainImage" src={ParkMainImage} />
        </div>
        <div className="ParkName">{ParkName}</div>
        <div className="ParkDescriptionBox">
          <div className="ParkDescription">{ParkDescription}</div>
        </div>
        <div className="AddressBox">
          <div className="AddressHeader">Address</div>
          <div className="AddressInfo">{PhysicalAddress}</div>
        </div>
        <div className="Directions Box">
          <div className="Directions Header">Directions</div>
          <div className="ReadMoreButton">Read More LINK</div>
        </div>
        <div className="ParkImageContainer">
          <div classname="ParkImageBoxes">{ParkImages}</div>
        </div>
        <div className="HomeLink">Back to Park List</div>
      </div>
    );
  }
}

export default ParkPage;
